INSERT INTO `channel` (`channel_id`, `channel_category`, `channel_name`, `channel_memo`) VALUES
(12, 1, '青年故事館', '為鼓勵青年透過自省產生行動力，更希望給予這些實踐者一個展現的舞臺，教育部青年發展署與國立教育廣播電臺合作，透過廣播傳遞青年參與國際交流、志工服務、見習工讀、還有壯遊、創業的故事。本節目希望成為青年築夢過程中的支持者與訊息平臺，同時也期待與其他年齡層聽眾分享臺灣青年陽光般的熱情與生命力。讓「青年故事館」帶領聽眾了解臺灣青年培力的成果，以及年輕生命勇於追夢與實踐理想的精采與感動。'),
(17, 1, '國際教育心動線', '主持人 : 謝若男\r\n在教育全球化、國際化趨勢下，國內對教育議題非常關注，惟討論常缺乏國際視野的觀點，國家教育研究院是我國重要之教育研究發展機構，經常性蒐集教育部駐外單位提供之國際教育資訊，並將資訊彙整於國際教育訊息電子報以及臺灣教育研究資訊網等網站，供各界參考。本院預計每週挑出重要且值得學習的國際教育訊息，輔以當前國際時事，邀訪該領域專家學者深入討論分析，讓國際教育資訊可以藉由國立教育廣播電臺全國網廣播頻道深化價值，也讓教育工作者，可固定瞭解國際教育脈動。節目中同時撥出部分時段介紹教師、家長、學生關心之重要教育議題，以及國家教育研究院製作之優良出版品與建置之網站、資料庫等教育資源。 '),
(18, 3, '藝術好好玩~神話連篇', '本單元以一集五分鐘時間，共計二十集講述世界各地流傳至今的神話，並且透過藝術作品一窺神話中人為展現出的種種面向。講述方法透過「神話故事」與「神話藝術」兩方內容，達成以「神話」為本單元的主軸路徑。\r\n\r\n貫穿早期人類社會歷史與西方藝術中的重要題材，一為宗教，一為神話。各個國家與時代裡人類往往透過神話訴說著世間生活、風俗民情、自然現象、人類情感和潛在慾望。千百年來，人們透過口耳相傳與文字紀錄神話；之後，藝術家透過作品進行的刻畫與描寫，成為人們靠近神話的另一種方法。本單元經由一次五分鐘的講述，深入淺出世界神話與人文，接觸人性情感和人類古老意象，讓知識普及化，點燃聽眾對於神話與人文的吸收熱情與興趣，進而培養主動學習及追求知識的能力。'),
(19, 6, '自然有意思', '大自然是最能啟發人心、最迷人的教室。\r\n本節目將以生態旅遊與自然觀察並行，帶領民眾遠觀山川大澤、細察蟲魚鳥獸，由認識自然、瞭解自然，而生守護自然之心；從生態議題與環境變遷中，省思並傳遞生態保育、永續地球的理念。');
